import Card from './Card';
import './name.css';
import Yourname  from './yourname';

function Myname(props){
    return (
    <Card className="gen">
        <Yourname date={props.date}/>
        <div className='tandm'>
            <h2>{props.title}</h2>
            <div className="mount">
                <h2>{props.amount}</h2>
            </div>
        </div>
    
    </Card>);
}
export default Myname;
